import React from 'react'
import './styles/homepage.css'
const Catalogue = document.getElementById("Catalogue");

class homepage extends React.Component {
    nextPage = () => {
        
        Catalogue.style.left = "0%";
    }
    render() {
        return(
            <div className="pages homepage_container">
                <span className="icon-paint-brush-solid icon" id="iconBrush"></span>
                <span onClick={this.nextPage} className=".icon-store-alt-solid icon" id="iconCatalogue"></span>
            </div>
        )
    }
}

export default homepage
